        public static int LengthOfLongestSubstring(string s)
        {
            if (s == "")
            {
                return 0;
            }
            
         
            if (s.Length == 1)
            {
                return s.Length;
            }
         
            String temp = "";
            String result = "";
           
            for (int i = 0; i < s.Length; i++)
            {
                if (temp.Contains(s[i])){
                    if (temp.Length > result.Length)
                    {
                        result = temp;
                    }
            
                    if (temp.Length != 1)
                    {
                        temp = "" + temp.Substring(temp.IndexOf(s[i]) + 1);
                        temp += s[i];
                    }
                    else
                    {
                        temp = "";
                        temp += s[i];
                    }
                    
                }
                else
                {
                    temp += s[i];
                    
                }
            }
            if (result == "")
            {
                result = temp;
            }
            if (temp.Length > result.Length)
            {
                result = temp;
            }
            return result.Length;
        }
